import React, { Component } from 'react';
//import { NavLink } from 'react-router-dom';
//import * as router from 'react-router-dom';
import PropTypes from 'prop-types';
import {
  CToggler,
  CHeaderBrand,
  CHeaderNav,
  CHeaderNavItem,
  CHeaderSubheader,
  CBreadcrumb,
  CLink
  } from '@coreui/react';
import {
  CIcon
} from '@coreui/icons-react';

// import Config from '../../Common/Config';

// routes config
import routes from '../../routes';

import DefaultHeaderDropdown  from './DefaultHeaderDropdown'
// import logo from '../../../assets/images/logo.png'


import logo from '../../assets/img/brand/coreui-pro-base.svg'
// import sygnet from '../../assets/img/brand/coreui-signet.svg'

const propTypes = {
  children: PropTypes.node,
};

const defaultProps = {};

class DefaultHeader extends Component {
  render() {

    // eslint-disable-next-line
    const {
      toggleSidebarMobile,
      toggleSidebar,
      toggleAside,
      toggleTheme
    } = this.props;

    return (
      <>

        <CToggler
          inHeader
          className="ml-3 d-lg-none"
          toggle={toggleSidebarMobile}
        />
        <CToggler
          inHeader
          className="ml-3 d-md-down-none"
          toggle={toggleSidebar}
        />
        <CLink href="/" target="_blank">
          <CHeaderBrand
            className="mx-auto d-lg-none"
            src={logo}
            width="97"
            height="46"
            alt="CoreUI Logo"
          />
        </CLink>

        <CHeaderNav className="d-md-down-none mr-auto">
          {/* <CHeaderNavItem custom className="px-3" to="/">
            Dashboard
          </CHeaderNavItem> */}
          <CHeaderNavItem to="/"className="px-3">
            Home
          </CHeaderNavItem>
        </CHeaderNav>

        <CHeaderNav>
          <CToggler
              custom
              inHeader
              className="ml-3 d-md-down-none"
              toggle={toggleTheme}
              title="Toggle Light/Dark Mode"
            >
            <CIcon name="cil-moon" className="c-d-dark-none" alt="CoreUI Icons Moon" />
            <CIcon name="cil-sun" className="c-d-default-none" alt="CoreUI Icons Sun" />
          </CToggler>        
          <DefaultHeaderDropdown onLogout={this.props.onLogout} accnt/>          
        </CHeaderNav>

        <CHeaderSubheader className="px-3 justify-content-between">
          <CBreadcrumb className="border-0 c-subheader-nav" appRoutes={routes} />           
        </CHeaderSubheader>

      </>
    );
  }
}

DefaultHeader.propTypes = propTypes;
DefaultHeader.defaultProps = defaultProps;

export default DefaultHeader;
